import axios from "axios";
import React, { useEffect, useState } from "react";

export default function Formulario() {
  const [resultado, setResultado] = useState([]);

  submitImg = (e) => {
    e.preventDefault();

    const bodyFormData = new FormData(e.target);
    let traerResultado = async () => {
      const res = await axios.post(
        "http://127.0.0.1:8000/detectar-objeto",
        bodyFormData
      );
      setResultado(res.data);
      console.log(res.data);
    };
  };

  changeHandler = (e) => {
    const el = e.target;
    this.setState({
      [el.name]: el.type === "file" ? el.files[0] : el.value,
    });
  };

  useEffect(() => {
    traerResultado();
  }, []);
  return (
    <body>
      <h2>Detectar Objeto</h2>
      <form onSubmit={submitImg()} encType="multipart/form-data">
        <input type="file" name="img1" />
        <button type="submit">Submit</button>
        <p>{resultado}</p>
      </form>
    </body>
  );
}
